import react, { useState } from "react";
import Results from "../VoteResults/Results";


export default function Vote({title, options}) {

    let [optionOneCount, setOptionOneCount] = useState(0);
    let [optionTwoCount, setOptionTwoCount] = useState(0);
    let [optionThreeCount, setOptionThreeCount] = useState(0);
    let [optionFourCount, setOptionFourCount] = useState(0);



    return (
        <div>
            <h1>{title}</h1>
            <button onClick={() => <Results title={title} options={options} count={+ setOptionOneCount + 1}/>}>{options[0]}</button><br></br>
            <button onClick={() => <Results title={title} options={options} count={+ setOptionTwoCount + 1}/>}>{options[1]}</button><br></br>
            <button onClick={() => <Results title={title} options={options} count={+ setOptionThreeCount + 1}/>}>{options[2]}</button><br></br>
            <button onClick={() => <Results title={title} options={options} count={+ setOptionFourCount + 1}/>}>{options[3]}</button><br></br>
        </div>
    )
}
